import React from 'react';
import {
  DSADefaultPage,
  GenerateLinks,
  GenerateRoutes,
} from '../../Routings.js';

const prefix = '/algorithms/shortest-path';
const pages = [
  {
    "name": "Linear",
    "route": "linear",
    "page": DSADefaultPage,
  },
  {
    "name": "Binary",
    "route": "binary",
    "page": DSADefaultPage,
  },
  {
    "name": "Breadth First",
    "route": "breadth-first",
    "page": DSADefaultPage,
  },
  {
    "name": "Depth First",
    "route": "depth-first",
    "page": DSADefaultPage,
  },
];

export const ShortestPathLinks  = () => <GenerateLinks  prefix={prefix} pages={pages}/>;
export const ShortestPathRoutes = () => <GenerateRoutes prefix={prefix} rootPage={SearchLinks} pages={pages}/>;
